import React, {useState} from 'react';

const InputElement = () => {

    const [inputText, setInputText] = useState("");

    return <input 
        onChange = { (e) => {
            setInputText(e.target)
        } }    
        placeholder="Enter Some Text" />;
};

export default InputElement;
